import React, {useState, useEffect} from 'react';
import '../App.css';

function Events() {

  useEffect(() => {
    fetchItems();
  }, []);

  const fetchEvents = async () => {
    const data = await fetch('https://uh.edu/news-events/index.xml');
    console.log(data);
  }

  return (
    <div className="App">
      <h1>Events</h1>
    </div>
  );
}

export default Events;
